import React from 'react'
import {Link} from 'react-router-dom';

export default function Navbar() {
    return (
        <div className="nav-bar">
           <Link to='/'>
               <h3 className="dashboard-heading navbel">Dashboard</h3>
           </Link>
           <Link to="/cart">
                   <h3 className="portf navbel">Portfolio</h3>
           </Link>
        </div>
    );
};
